import Header from './components/Header';
import Dashboard from './pages/Dashboard';
import About from './pages/About';
import {
  Routes,
  Route,
} from "react-router-dom";
function App() {
  return (
    <div >
      <Header/>
      <Routes>
        <Route path='/' element={<Dashboard/>}/>
        <Route path='about' element={<About/>}/>
      </Routes>
      <Dashboard/>
      <About/>
    </div>
  );
}

export default App;
